import React from 'react'
import d from './Dialogs.module.css';
import {NavLink} from "react-router-dom";


const DialogItem = (dialogProps) => {
    let path = "/dialogs/" + dialogProps.id;
    return (
        <div className={d.dialog}>
            <NavLink to={path}>{dialogProps.name}</NavLink>
        </div>
    )
}
const Message = (mprops) => {
    return (
        <div className={d.message}>{mprops.message}</div>
    )
}
const Dialogs = (props) => {
    let dialogsData = [
        {id: 1, name: 'Vlad'},
        {id: 2, name: 'Oleg'},
        {id: 3, name: 'Sveta'},
        {id: 4, name: 'Katya'},
        {id: 5, name: 'Olya'}
    ]
    return (
        <div className={d.dialogs}>
            <div className={d.dialogsItems}>
                <DialogItem name={dialogsData[0].name} id={dialogsData[0].id}/>
                <DialogItem name={dialogsData[1].name} id={dialogsData[1].id}/>
                <DialogItem name="Sveta" id='3'/>
                <DialogItem name="Katya" id='4'/>
                <DialogItem name="Olya" id='5'/>
            </div>
            <div className={d.messages}>
                <Message message="ky"/>
                <Message message="hi"/>
                <Message message="check"/>
            </div>
        </div>
    )
}
export default Dialogs;
